INSERT INTO `pokemon_habitats` VALUES (1,'cave','This is your underground habitat, typically natural, but also including man-made mines and tunnels through the mountains.'),(2,'forest','Forests are typically you more traditional woodlands where there are large gatherings of standing trees, mostly deciduous and/or evergreens.'),(3,'grassland','Typically, grasslands are rolling plains, but grasslands can be as simple as what their name entitles: anyplace where the main vegetation isnt standing trees, ranging from simple common grass to farmlands of wheat/cotton/corn or otherwise.'),(4,'mountain','Mountains are elevated environments that range in variance of both height and features. Some are tall and rocky ranges. Some are snowy forested peaks.'),(5,'rare','Non-Space is a unique habitat. Its not truly defined. The easiest way to describe it is to state that \"Non-Space\" doesnt exist in our reality, but more as another alternative dimension of nonexistence. '),(6,'rough-terrain','Wastelands. Badlands. Dry air, little water to drink, and sand as far as the eye can see. Cold or warm deserts exist, but one thing they have in common: They are extreme environments where only the most adaptable to the harsh conditions survive.'),(7,'sea','Saltwater oceans and seas are the Ocean habitat, ranging from its surface to its darkest depths far below sea-level where even light doesnt reach into the abyss of darkness. Commonplace, Ocean habitats go hand-in-hand with the Beach habitat when near land, but otherwise, this habitat doesnt include land: its all saltwater!'),(8,'urban','The last habitat, Urban, is the man-made habitat of urbanization and industrialization. Towns, Cities, Settlements. Places where people gather in large populations where the wilderness has been claimed by humans and made less natural. It ranges from the streets and parks, to alleys and even sewer systems that make a city what it is. '),(9,'waters-edge','Lakes, rivers, streams, and ponds. If it is water and isnt saltwater oceans/seas, its going to be freshwater. Freshwater is mostly commonplace anywhere inland that water can be found naturally. Just make sure the water the pokemon can be found in is deep enough for it! Freshwater can range from the surface of the water, its shoreline, and to underwater environments.'),(10,'Unknown','Unknown');
